const createElement = <K extends keyof HTMLElementTagNameMap>(
  tagName: K,
  attrs?: Partial<HTMLElementTagNameMap[K]>
): HTMLElementTagNameMap[K] => {
  return Object.assign(document.createElement(tagName), attrs || {});
};

const style = createElement("style", {
  innerText: `
html, body {
    width: 100%;
    height: 100%;
    font-family: "Segoe UI";
    color: white;
    margin: 0px;
    padding: 0px;
    background: black;
    overflow: hidden;
}

#stats {
    position:absolute;
    right:10px;
    top:10px;
    color:black;
}

#message {
    position:absolute;
    left:40px;
    right:40px;
    bottom:30px;
    text-align: center;
    color:white;
    font-size: 40px;
    text-shadow: 4px 4px 4px black;
    cursor: pointer;
}`
});

const canvas = createElement("canvas", { id: "tunnelCanvas" });
const message = createElement("div", {
  id: "message",
  innerText: "Click To Start"
});
const stats = createElement("div", { id: "stats" });

[style, canvas, message, stats].forEach(
  document.body.appendChild,
  document.body
);

(() => {
  const computeFPS = () => {
    if (previous.length > 60) {
      previous.splice(0, 1);
    }

    let sum = 0;
    const start = new Date().getTime();
    previous.push(start);

    for (let id = 0; id < previous.length - 1; id++) {
      sum += previous[id + 1] - previous[id];
    }

    const diff = 1000.0 / (sum / previous.length);

    stats.innerHTML = diff.toFixed() + " fps";
  };

  const loadTexture = (name, then) => {
    const texture = new Image();
    const result: {
      width?: number;
      height?: number;
      data?: Uint8ClampedArray;
    } = {};

    // on load
    texture.addEventListener(
      "load",
      (e: any) => {
        const textureCanvas = document.createElement("canvas"); // off-screen canvas

        // Setting the canvas to right size
        textureCanvas.width = e.target.width; //<-- "this" is the image
        textureCanvas.height = e.target.height;

        result.width = e.target.width;
        result.height = e.target.height;

        const textureContext = textureCanvas.getContext("2d");
        textureContext.drawImage(e.target, 0, 0);

        result.data = textureContext.getImageData(
          0,
          0,
          e.target.width,
          e.target.height
        ).data;

        then();
      },
      false
    );

    // Loading
    texture.src = name;

    return result;
  };

  const renderingLoop = () => {
    let radius, u, v, w;
    let canvasIndex = 0;
    let textureIndex = 0;

    // Compute FPS
    if (render) computeFPS();

    let index = 0;
    for (let y = -canvasHeight / 2; y < canvasHeight / 2; y++) {
      for (let x = -canvasWidth / 2; x < canvasWidth / 2; x++) {
        radius = Math.sqrt(x * x + y * y);

        u = (5.0 + 40.0 * Math.abs(Math.cos(angle))) / radius;
        v = 0.5 * atans[index++];
        w = radius * 0.01;

        u = u * texture.width + zoom;
        v = v * texture.height;

        u =
          (u < 0
            ? texture.width + (u % texture.width)
            : u >= texture.width
            ? u % texture.width
            : u) >> 0;
        v =
          (v < 0
            ? texture.height + (v % texture.height)
            : v >= texture.height
            ? v % texture.height
            : v) >> 0;

        textureIndex = (u + v * texture.width) * 4;
        canvasIndex =
          (x + canvasWidth / 2 + (y + canvasHeight / 2) * canvasWidth) * 4;

        destinationData[canvasIndex] = texture.data[textureIndex] * w;
        destinationData[canvasIndex + 1] = texture.data[textureIndex + 1] * w;
        destinationData[canvasIndex + 2] = texture.data[textureIndex + 2] * w;
      }
    }

    context.putImageData(imageData, 0, 0);
    zoom += speed;
    angle += 0.05;

    if (render) {
      QueueNewFrame();
    }
  };

  let intervalID = -1;
  let QueueNewFrame = () => {
    if (window.requestAnimationFrame)
      window.requestAnimationFrame(renderingLoop);
    else {
      QueueNewFrame = () => void 0;
      intervalID = window.setInterval(renderingLoop, 16.7);
    }
  };

  // FPS
  const previous = [];
  const stats = document.getElementById("stats");

  // Getting canvas and context
  const canvas: HTMLCanvasElement = document.getElementById(
    "tunnelCanvas"
  ) as HTMLCanvasElement;
  const context = canvas.getContext("2d");

  // Setting hardware scaling
  canvas.width = 300;
  canvas.style.width = window.innerWidth + "px";
  canvas.height = 200;
  canvas.style.height = window.innerHeight + "px";

  // Clear
  context.fillStyle = "#000";
  context.fillRect(0, 0, canvas.width, canvas.height);

  // Getting destination infos
  const imageData = context.getImageData(0, 0, canvas.width, canvas.height);
  const destinationData = imageData.data;

  // Parameters
  let render = false;
  let zoom = 0;
  const speed = 20;
  let angle = 0;
  const canvasWidth = canvas.width;
  const canvasHeight = canvas.height;

  // precompute arctangent
  const atans = [];

  let index = 0;
  for (let y = -canvasHeight / 2; y < canvasHeight / 2; y++) {
    for (let x = -canvasWidth / 2; x < canvasWidth / 2; x++) {
      atans[index++] = Math.atan2(y, x) / Math.PI;
    }
  }

  // Click
  const message = document.getElementById("message");
  message.onclick = () => {
    render = !render;

    if (intervalID !== -1) window.clearInterval(intervalID);

    if (render) {
      message.innerHTML = "Click to Stop";

      if (intervalID !== -1)
        intervalID = window.setInterval(renderingLoop, 16.7);
      else QueueNewFrame();
    } else {
      message.innerHTML = "Click to Start";
      stats.innerHTML = "";
    }
  };

  // Texture
  const texture = loadTexture(
    "tiles:image/png;base64,",
    renderingLoop
  );
})();
